INSERT INTO `ks_video_description` VALUES (7,2,'Gìan Tạ Đa Năng BK1998 -10 trong 1','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/5edmc_nGQWA?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Giàn tạ đa năng 10 trong 1 kingsport 1998 - Gian ta da nang 10 trong 1 kingsport 1998','','gian ta da nang, giàn tạ đa năng','https://www.youtube.com/watch?v=5edmc_nGQWA'),(8,2,'Quạt Điều Hòa Không Khí Magic Cool - Giải pháp làm mát thay thế máy lạnh','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/8rnTjxDtj78?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Quạt Điều Hòa Không Khí Magic Cool - Giải pháp làm mát thay thế máy lạnh - Quat Dieu Hoa Khong Khi Magic Cool - Giai phap lam mat thay the may lanh','Quạt điều hòa không khí Magic Cool còn được gọi là máy làm mát, là một trong những giải pháp làm mát được lựa chọn hàng đầu hiện nay','quat lam mat, quat dieu hoa,may lam mat,quat khong khi','https://www.youtube.com/watch?v=8rnTjxDtj78'),(9,2,'Bộ Tập Thể Hình Đa Năng 15 Trong 1- BK 1998 NEW 2016','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/NtUIrP44rV8?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Bộ Tập Thể Hình Đa Năng 15 Trong 1- BK 1998 NEW 2016 - Bo Tap The Hinh Da Nang 15 Trong 1- BK 1998 NEW 2016','Các bài tập cơ bản: Tập Cơ bụng, Cơ ngực trên, cơ ngực dưới, Cơ vai, kéo xô trước, xô sau, Cơ tay, cơ đùi, cơ bắp đùi, mông, cơ bắp chuối','gian tap da nang, may tap da nang, may tap ta da nang,gian tap ta da nang','https://www.youtube.com/watch?v=NtUIrP44rV8'),(10,2,'Quạt Điều Hòa Magic Cool MC 06- Bền Đẹp Làm Nhà Bạn Thêm Sang Trọng','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/0me7iFz9H-c?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Quạt Điều Hòa Magic Cool MC 06- Bền Đẹp Làm Nhà Bạn Thêm Sang Trọng - Quat Dieu Hoa Magic Cool MC 06- Ben Dep Lam Nha Ban Them Sang Trong','Quạt điều hòa Magic Cool MC06 đến từ Đài Loan giúp tiết kiệm điện năng tối đa với công suất chỉ 120W. Bình chứa nước có thể tích 10 lít có thể hoạt động liên tục trong vòng 10 giờ mà không sợ hết nước','quat dieu hoa,máy làm mát,may lam mat,quạt điều hòa,quat khong khi','https://www.youtube.com/watch?v=0me7iFz9H-c'),(11,2,'KingSport Hỗ Trợ Tư Vấn Mở Phòng Gym Miễn Phí- 18006862','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/tBU2BJchays?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','KingSport Hỗ Trợ Tư Vấn Mở Phòng Gym Miễn Phí- 18006862 - KingSport Ho Tro Tu Van Mo Phong Gym Mien Phi- 18006862','Lập dự toán đầu tư dựa theo ngân sách và diện tích phòng Gym mà bạn có. Dựa theo địa điểm và diện tích mặt bằng, chúng tôi sẽ tư vấn, phân tích và đánh giá tiềm năng kinh doanh của địa điểm mà bạn muốn đầu tư. Từ đó đưa ra được: tổng mức đầu tư, chi phí và dự kiến doanh thu cho phòng Gym','tu van gym, tu van mo phong gym,mo phong tap gym,tu van mo phong tap','https://www.youtube.com/watch?v=tBU2BJchays'),(12,2,'Quạt Hơi Nước MC 01- Giải Pháp Mới Cho Ngày Hè Nóng Nực','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/zWvo66qczdI?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Quạt Hơi Nước MC 01- Giải Pháp Mới Cho Ngày Hè Nóng Nực - Quat Hoi Nuoc MC 01- Giai Phap Moi Cho Ngay He Nong Nuc','Quạt điều hòa Magic Cool MC01 sử dụng công nghệ Đài Loan tiên tiến nhất, tiết kiệm điện năng với công suất 80W, làm mát nhanh một lượng không khí cực lớn với lưu lượng xử lý cao','quat hoi nuoc,quat dieu hoa,quat khong khi,quat phun suong','https://www.youtube.com/watch?v=zWvo66qczdI'),(13,2,'THIẾT BỊ TẬP GYM KINGSPORT KL','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/iPlHU5i3ufA?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','THIẾT BỊ TẬP GYM KINGSPORT KL - THIET BI TAP GYM KINGSPORT KL','','','https://www.youtube.com/watch?v=iPlHU5i3ufA'),(14,2,'MÁY TẬP GYM DÒNG KINGSPORT KM TỔNG HỢP','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/0RKyU_QPZAM?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','MÁY TẬP GYM DÒNG KINGSPORT KM TỔNG HỢP - MAY TAP GYM DONG KINGSPORT KM TONG HOP','','','https://www.youtube.com/watch?v=0RKyU_QPZAM'),(15,2,'Hướng Dẫn Bảo Dưỡng Máy Chạy Bộ Tại Nhà 18006862','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/gbLkNdeb6-Q?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Hướng Dẫn Bảo Dưỡng Máy Chạy Bộ Tại Nhà 18006862 - Huong Dan Bao Duong May Chay Bo Tai Nha 18006862','Hướng dẫn bảo trì máy chạy bô , hướng dẫn xài máy chạy bộ bền trên 30 năm','bao tri may chay bo,bao hanh may chay bo,huong dan su dung may chay bo','https://www.youtube.com/watch?v=gbLkNdeb6-Q'),(16,2,'Hướng Dẫn Sử Dụng Máy Chạy Bộ Tại Nhà 18006862','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/ITPTipWkOKk?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Hướng Dẫn Sử Dụng Máy Chạy Bộ Tại Nhà 18006862 - Huong Dan Su Dung May Chay Bo Tai Nha 18006862','Những hướng dẫn cách sử dụng máy chạy bộ cho người mới tập giúp tối đa hóa quá trình luyện, tránh việc luyện tập không đúng gây trở ngại cho việc giảm cân và t','huong da su dung may chay bo, cach su dung may chay bo,huong dan su dung may chay bo dien','https://www.youtube.com/watch?v=ITPTipWkOKk'),(17,2,'Cùng Trải Nghiệm Dịch Vụ Thiết Bị Thể Thao Thông Minh Của Kingsport','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/MzMTXs8gB38?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Cùng Trải Nghiệm Dịch Vụ Thiết Bị Thể Thao Thông Minh Của Kingsport - Cung Trai Nghiem Dich Vu Thiet Bi The Thao Thong Minh Cua Kingsport','Tại Kingsport chúng tôi đảm bảo sẽ gửi đến Quý khách những sản phẩm chất lượng tốt nhất, Chúng tôi tin rằng việc lựa chọn một sản phẩm giá trị và đặt hàng qua điện thoại, hay mạng internet là một việc khó khăn và chưa phải thói quen mua sắm của người Việt','kingsport, kingsport la gi,kingsport o dau,kingsport tot khong','https://www.youtube.com/watch?v=MzMTXs8gB38'),(18,2,'Máy Massage Chân Kingsport - Massage Chân Hiệu Quả Nhất','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/pjVjo4hFumw?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Máy Massage Chân Kingsport - Massage Chân Hiệu Quả Nhất - May Massage Chan Kingsport - Massage Chan Hieu Qua Nhat','Máy massage chân Kingsport là một thiết bị chăm sóc sức khỏe cần thiết cho mỗi gia đình. Với những ai thường cảm thấy đau nhức ở chân, những người tập thể thao ở cường độ mạnh, người thường xuyên đi giày cao gót hay phải thường xuyên di chuyển hoặc đứng quá nhiều trong ngày','may massage chan,may mat xa chan, may matxa chan,may mátxa chan','https://www.youtube.com/watch?v=pjVjo4hFumw'),(19,2,'Xe Đạp Tập Thể Dục KingSport Xbike V5','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/tXtJ0MiLXA8?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Xe Đạp Tập Thể Dục KingSport Xbike V5 - Xe Dap Tap The Duc KingSport Xbike V5','Xe đạp tập X-Bike V5 là một lựa chọn hoàn hảo cho gia đình của bạn trong việc giảm cân và lấy lại vóc dáng săn chắc nhanh chóng. Với thiết kế nhỏ gọn nhưng công dụng thì trên cả tuyệt vời – giảm mỡ ở bụng, eo, bắp tay, đùi, bắp chân','xe dap tap tai cho, xe dap tap the duc, xe dap tap tai nha','https://www.youtube.com/watch?v=tXtJ0MiLXA8'),(20,2,'Hướng Dẫn Lắp Ráp Máy Chạy Bộ Caribe Lady Đa Năng','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/ZZzBCLUDF2c?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Hướng Dẫn Lắp Ráp Máy Chạy Bộ Caribe Lady Đa Năng - Huong Dan Lap Rap May Chay Bo Caribe Lady Da Nang','','','https://www.youtube.com/watch?v=ZZzBCLUDF2c'),(21,2,'Máy xay đa năng công nghiệp super vitamix','&lt;iframe width=&quot;600&quot; height=&quot;500&quot; src=&quot;http://www.youtube.com/embed/Ud0ddgueXPM?autoplay=0&start=0&theme=dark&disablekb=0&showinfo=1&modestbranding=0&controls=1&autohide=0&color=red&loop=0&rel=1&hd=0&quot; frameborder=&quot;0&quot;  allowfullscreen&gt;&lt;/iframe&gt;','','Máy xay đa năng công nghiệp super vitamix','Máy xay đa năng công nghiệp super vitamix','Máy xay đa năng công nghiệp super vitamix','https://www.youtube.com/watch?v=Ud0ddgueXPM');
